goog.provide("goog.fx.easing");goog.fx.easing.easeIn=function(t){return goog.fx.easing.easeInInternal_(t,3)};goog.fx.easing.easeInInternal_=function(t,exp){return Math.pow(t,exp)};goog.fx.easing.easeOut=function(t){return goog.fx.easing.easeOutInternal_(t,3)};goog.fx.easing.easeOutInternal_=function(t,exp){return 1-goog.fx.easing.easeInInternal_(1-t,exp)};goog.fx.easing.easeOutLong=function(t){return goog.fx.easing.easeOutInternal_(t,4)};goog.fx.easing.inAndOut=function(t){return 3*t*t-2*t*t*t};